text:
Two weeks ago I received a sincere-sounding email where the sender claimed to be an executive of a company and said they were looking to fill a specific role. The email contains a link to their LinkedIn profile and a real link to the the job as posted on the careers section of the company. However, the sender’s return email address has a domain of &lt;company_name&gt;.careers. The root domain is .careers and the pattern is &lt;firstname&gt;@&lt;companyname&gt;.careers. It seemed odd to me but I figured this was just a secondary domain of the company. I replied to this email only to get a boilerplate response a week later which basically said “thank you for responding we will get back to you” and then I was ghosted.<p>Most recently, I received another email with a very similar pattern, but different enough to be unique. It was verbose and felt very much something like ChatGPT would create.<p>I have many questions. At best, it might be genuine. At worst, it’s a job farming operation by an unscrupulous recruiter impersonating the real executive through the clever use of a .careers domain. My mistrust came when the follow-on reply was not characteristic of the tone of the initial outreach.<p>What are your thoughts here?<p>=====================<p>Hi &lt;FIRST NAME&gt;<p>I&#x27;m &lt;FIRST NAME OF THE EXECUTIVE, WITH LINK TO A LINKEDIN PROFILE&gt;, the Head of Finance at &lt;COMPANY NAME WITH LINK TO THE CAREERS SECTION OF COMPANY WEBSITE&gt; and we are …<p>Are you open to exploring opportunities outside of &lt;CURRENT PLACE OF WORK&gt;…<p>I&#x27;d also love to discuss &lt;AN INTERESTING ANECDOTE PULLED FROM LINKEDIN PROFILE&gt; …<p>We are on a mission to &lt;A BLURB ABOUT THE COMPANY&gt; …<p>We&#x27;re looking for a &lt;LINK TO ROLE HERE&gt;  who is passionate about …<p>A member of our team would be glad to chat with you if you&#x27;d like to learn more.<p>Thank you,
&lt;FIRST NAME OF THE EXECUTIVE&gt;<p>=====================<p>Hey &lt;FIRST NAME&gt;,<p>I&#x27;m &lt;FIRST NAME OF THE EXECUTIVE, WITH A LINK TO A LINKEDIN PROFILE&gt; and I&#x27;m the Head of Engineering at &lt;COMPANY NAME WITH LINK TO THE CAREERS SECTION OF COMPANY WEBSITE&gt; and we are a …<p>How are things going at &lt;CURRENT PLACE OF WORK&gt;?  …<p>I&#x27;d also love to know how you &lt;AN INTERESTING ANECDOTE PULLED FROM THE LINKEDIN PROFILE&gt; …<p>We&#x27;ve experienced enormous growth &lt;A BLURB ABOUT THE COMPANY&gt; …<p>We are now hiring experienced &lt;LINK TO ROLE HERE&gt; who can …<p>Are you available sometime in the coming days for a chat with our team?<p>Best,
&lt;FIRST NAME OF THE EXECUTIVE&gt;
